import React, { useContext, useEffect } from "react";
import Link from "next/link";
import Router from "next/router";
import Button from "components/Button/Button";
import InputIncDec from "components/InputIncDec/InputIncDec";
import {
  ProductDetailsWrapper,
  ProductPreview,
  ProductInfo,
  ProductTitle,
  BackButton,
  ProductWeight,
  ProductDescription,
  ProductMeta,
  ProductCartWrapper,
  ProductPriceWrapper,
  ProductPrice,
  SalePrice,
  ProductCartBtn,
  MetaSingle,
  MetaItem,
  RelatedItems,
} from "./ProductDetails.style";
import { LongArrowLeft, CartIcon } from "components/AllSvgIcon";
import ReadMore from "components/Truncate/Truncate";
import CarouselWithCustomDots from "components/MultiCarousel/MultiCarousel";
import ServiceProvider from "containers/ServiceProvider/ServiceProvider";
import { CartContext } from "contexts/cart/cart.context";
import { CURRENCY } from "helper/constant";
import { findProductIndex, getProductQuantity } from "helper/utility";
import { Magasin } from "interfaces";
import { FormattedMessage } from "react-intl";
import LanguageContext from "contexts/language/language.context";

type MagasinPageProps = {
  magasin: Magasin | any;
  deviceType: {
    mobile: boolean;
    tablet: boolean;
    desktop: boolean;
  };
};

const MagasinPage: React.FunctionComponent<MagasinPageProps> = ({
  magasin,
  deviceType,
}) => {
  const {
    state: { lang },
  }: any = useContext(LanguageContext);
  console.log(magasin);
  const { add, update, products } = useContext(CartContext);
  const data = magasin;
  const index = findProductIndex(products, data.id);
  const quantity = getProductQuantity(products, index);

  const handleClick = (e) => {
    e.stopPropagation();
    add(e, data);
  };

  const handleUpdate = (value: number, e: any) => {
    if (index === -1 && value === 1) {
      add(e, data);
    } else {
      update(data.id, value);
    }
  };

  useEffect(() => {
    setTimeout(() => {
      window.scrollTo(0, 0);
    }, 500);
  }, []);

  return (
    <>
      <ProductDetailsWrapper className="product-card" dir="ltr">
        {lang === "ar" || lang === "he" ? (
          ""
        ) : (
          <ProductPreview>
            <BackButton>
              <Button
                title="Back"
                intlButtonId="backBtn"
                iconPosition="left"
                size="small"
                style={{
                  backgroundColor: "#ffffff",
                  border: "1px solid #f1f1f1",
                  color: "#77798c",
                }}
                icon={<LongArrowLeft />}
                onClick={Router.back}
              />
            </BackButton>

            <CarouselWithCustomDots
              items={magasin.image}
              deviceType={deviceType}
            />
          </ProductPreview>
        )}

        <ProductInfo dir={lang === "ar" || lang === "he" ? "rtl" : "ltr"}>
          <ProductTitle>{magasin.title}</ProductTitle>
          <ProductWeight>{magasin.image}</ProductWeight>
          <ProductDescription>
            <ReadMore character={600}>{magasin.description}</ReadMore>
          </ProductDescription>

          <ProductCartWrapper>
            <ProductCartBtn>
              {quantity <= 0 ? (
                <Button
                  title="Add to Cart"
                  intlButtonId="addToCartButton"
                  iconPosition="left"
                  size="small"
                  className="cart-button"
                  icon={<CartIcon />}
                  onClick={(e) => handleClick(e)}
                />
              ) : (
                <InputIncDec
                  value={quantity}
                  onClick={(e: any) => {
                    e.stopPropagation(onclick);
                  }}
                  onUpdate={(value: number, e) => handleUpdate(value, e)}
                />
              )}
            </ProductCartBtn>
          </ProductCartWrapper>
        </ProductInfo>

        {lang === "ar" || lang === "he" ? (
          <ProductPreview>
            <BackButton>
              <Button
                title="Back"
                intlButtonId="backBtn"
                iconPosition="left"
                size="small"
                style={{
                  backgroundColor: "#ffffff",
                  border: "1px solid #f1f1f1",
                  color: "#77798c",
                }}
                icon={<LongArrowLeft />}
                onClick={Router.back}
              />
            </BackButton>

            <CarouselWithCustomDots
              items={magasin.image}
              deviceType={deviceType}
            />
          </ProductPreview>
        ) : (
          ""
        )}
      </ProductDetailsWrapper>

      <RelatedItems>
        <h2>
          <FormattedMessage
            id="intlReletedItems"
            defaultMessage="Related Items"
          />
        </h2>
      </RelatedItems>
    </>
  );
};

export default MagasinPage;
